import React from "react";
import Container from '../components/Container';
import Block from '../components/Block';

function Portfolio() {
  return (
  <Block backgroundColor='black'>
    <Container>
    <Block height='600px' backgroundColor='red'>
    </Block>
    </Container>
  </Block>
  );
}

export default Portfolio;
